Interfaces are represented in the Rust world as a struct with an impl block containing methods. In the Kotlin or Swift world, it's a class. Because Objects are passed by reference and Dictionaries by value, in the uniffi world it is impossible to be both an Object and a Dictionary . The following Rust code: struct TodoList { items: Vec<String>
} impl TodoList { fn new() -> Self { TodoList { items: Vec::new() } } fn add_item(&mut self, todo: String) { self.items.push(todo); } fn get_items(&self) -> Vec<String> { self.items.clone() }
} would be exposed using: interface TodoList { constructor(); void add_item(string todo); sequence<string> get_items();
}; By convention, the constructor() calls the Rust's new() method. Conceptually, these interface objects are live Rust objects that have a proxy on the foreign language side; calling any methods on them, including a constructor or destructor results in the corresponding methods being call in Rust. uniffi will generate these proxies of live objects with an interface or protocol. e.g. in Kotlin. interface TodoListInterface { fun addItem(todo: String) fun getItems(): List<String>
} class TodoList : TodoListInterface { // implementations to call the Rust code.
} When working with these objects, it may be helpful to always pass the interface or protocol, but construct the concrete implementation. e.g. in Swift let todoList = TodoList()
todoList.addItem(todo: "Write documentation")
display(list: todoList) func display(list: TodoListProtocol) { let items = list.getItems() items.forEach { print($0) }
}

